import React from "react"
import virusimg from "../images/virus.jpg"
 class Navbar extends React.Component{
     render(){
         return(
             <>
             <div className="nav">
                 <div className="left-nav">
                     <img src={virusimg}></img>
                     <span>Covid-19</span>
                 </div>
                 <div className="right-nav">khan</div>
             </div>
             </>
         )
     }
 }
 export default Navbar
